import styled from "styled-components";

export const BigCircle = styled.div`
   height:3.5em;
   width:3.5em;
   border-radius:3.5em;
   background-color:#6C7B8A;
   box-sizing:border-box;

   bottom: 5em;
   right: 2em;
   z-index:100;
   position:fixed;

   display:flex;
   flex-direction:row;
   justify-content:center;
   align-items:center;

   font-size: 2em;
   color:#ffffff;
`
